import {
    GET_ENTRY_DATA,
    GET_ENTRY_DATA_SUCCESS,
    GET_ENTRY_DATA_ERROR
  } from "./actionTypes"

  export const getEntryData = () => ({
    type: GET_ENTRY_DATA,
  })
  
  export const getEntryDataSuccess = resp => ({
    type: GET_ENTRY_DATA_SUCCESS,
    payload: resp,
  })
  
  export const getEntryDataFail = error => ({
    type: GET_ENTRY_DATA_ERROR,
    payload: error,
  })
